import{_ as t,c as o,o as i,ah as n}from"./chunks/framework.PvdZnrZd.js";const d=JSON.parse('{"title":"SHIPROCKET SHIPPING","description":"SHIPROCKET SHIPPING","frontmatter":{"title":"SHIPROCKET SHIPPING","description":"SHIPROCKET SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/shiprocket-shipping.md","filePath":"zenith/featured-app/shipping/shiprocket-shipping.md"}'),r={name:"zenith/featured-app/shipping/shiprocket-shipping.md"};function a(l,e,p,s,h,c){return i(),o("div",null,[...e[0]||(e[0]=[n('<p>The <a href="/zenith/introduction/"><strong>Multi-vendor Marketplace</strong></a> has introduced another shipping feature app for order fulfillment named <a href="https://www.shiprocket.in/" target="_blank" rel="noreferrer"><strong>Shiprocket</strong></a>.</p><p>It is a Delhi-based BigFoot Retail solution that is India&#39;s first automated shipping software that aims to reduce eCommerce shipping to its bare bones.</p><p>By enabling the Shiprocket shipping featured app,</p><p>the admin can allow the sellers to manage both the order fulfillment using the Shiprocket shipping and generate the shipping labels for the orders</p><p>This feature app comes will charge you <strong>$10 per month</strong> in addition to your current Multivendor plan.</p><p><strong>Note</strong>:- “Shiprocket feature is available only in the Multivendor <strong>PRO ($60/month)</strong> Plan and you need to enable the <a href="/zenith/featured-app/overview.html"><strong>Shipping Feature App</strong></a>&quot; that is <strong>FREE</strong> of cost.”</p><p>To make the shipping feature work, you need to choose the Shopify store plan which supports the <strong>“Real-Time Carrier-Calculated Shipping”</strong></p><p>THIS SHIPPING FEATURE APP IS USED <strong>ONLY FOR FULFILLMENT</strong>.</p><h3 id="how-to-enable-shiprocket-shipping-feature" tabindex="-1">How to Enable Shiprocket Shipping Feature? <a class="header-anchor" href="#how-to-enable-shiprocket-shipping-feature" aria-label="Permalink to &quot;How to Enable Shiprocket Shipping Feature?&quot;">​</a></h3><p>To enable the feature app, all you need is to visit the “<strong>Featured Apps</strong>” section of the admin panel and enable it from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/featuredapps.webp" alt="Home-_-Admin-2"></p><p>Once you click on “Feature Apps”, you will get the list of apps listing in the section. There, You will get the Shiprocket feature. You just need to click the <strong>enable</strong> button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/shprckt.webp" alt="feature_apps___admin"></p><h3 id="workflow" tabindex="-1"><strong>Workflow</strong> <a class="header-anchor" href="#workflow" aria-label="Permalink to &quot;**Workflow**&quot;">​</a></h3><h3 id="admin-end" tabindex="-1">ADMIN END <a class="header-anchor" href="#admin-end" aria-label="Permalink to &quot;ADMIN END&quot;">​</a></h3><p>Once you enable the feature app, a new sub-menu named Shiprocket configuration is added to the configuration menu of the app.</p><p><strong>Note</strong>- You need to have an <a href="https://app.shiprocket.in/login" target="_blank" rel="noreferrer"><strong>account on the shiprocket</strong></a> to configure the details in the app.</p><p>Before this, You need to visit:</p><p>The Configuration&gt;&gt;Shipping Methods and <strong>enable the Shiprocket Shipping</strong> as shown in the below screenshot:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/shippigmethods.webp" alt="Dashboard-_-Admin"></p><p>Enable the Shiprocket Shipping:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/enableshiprocket.webp" alt="Configuration-_-Admin-2"></p><p>Now, proceed to configure the Shiprocket details</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/shiprocketconfig.webp" alt="Configuration-_-Admin-4"></p><h2 id="shiprocket-configuration" tabindex="-1">Shiprocket Configuration <a class="header-anchor" href="#shiprocket-configuration" aria-label="Permalink to &quot;Shiprocket Configuration&quot;">​</a></h2><p>In this section, you need to configure the shiprocket shipping details such as email id, and password. You will get all these details from your <a href="https://app.shiprocket.in/login" target="_blank" rel="noreferrer"><strong>shiprocket account.</strong></a></p><p>To allow the sellers to generate the shipping labels automatically on the fulfilled order all you need to enable the tab in the configuration menu.</p><p>Automatic generate shipping label:- Enable this tab if you want to generate the shipping labels automatically on order fulfillment.</p><p>Shipping label cost borne by:- Admin will bear the Shipping label cost.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/shiprocketconfig.webp" alt="Shiprocket-Configuration-Admin"></p><p><strong>NOTE-</strong> The Shiprocket API configure token will be generated automatically once these configurations are saved</p><h3 id="how-to-get-shiprocket-api-email-id-and-password" tabindex="-1">How to get Shiprocket API Email id and Password? <a class="header-anchor" href="#how-to-get-shiprocket-api-email-id-and-password" aria-label="Permalink to &quot;How to get Shiprocket API Email id and Password?&quot;">​</a></h3><p>Firstly, you need to log in to the Shiprocket shipping: <a href="https://app.shiprocket.in/login" target="_blank" rel="noreferrer">https://app.shiprocket.in/login</a></p><p><strong>Note</strong>- You need to have an API account on the <strong>Shiprocket</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/01/Shiprocket-1200x627.png" alt="Shiprocket"></p><p>Once you login into your shiprocket account, you will be redirected to the dashboard. Click on the <strong>settings</strong> menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/01/image-3-2-1200x580.png" alt="image-3-2"></p><p>Like this, you will get the details and configure the same in the app to make the Shiprocket shipping work.</p><h3 id="seller-panel-configuration" tabindex="-1">Seller Panel Configuration <a class="header-anchor" href="#seller-panel-configuration" aria-label="Permalink to &quot;Seller Panel Configuration&quot;">​</a></h3><p>Once you configure these details, the sellers will also get the option to enable the Shiprocket shipping from the <strong>Shipping Configuration</strong> menu of their seller panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/01/Shipping-Configuration-_-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Shipping-Configuration-_-Seller-•-Multivendor-MarketPlace"></p><p>If the seller needs to configure the shipping packet details then this can be done from the Global Shipping Configuration:</p><p>Configure Width, height, length, girth, and weight.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/globalconfigseller.webp" alt="Shipping-Configuration-_-Seller-•-Multivendor-MarketPlace-1"></p><p>Now, the seller can fulfill the orders using the Shiprocket shipping courier service.</p><h3 id="verify-the-pickup-location" tabindex="-1">Verify the pickup location. <a class="header-anchor" href="#verify-the-pickup-location" aria-label="Permalink to &quot;Verify the pickup location.&quot;">​</a></h3><p>Once the seller enables the shiprocket shipping, a pickup location is created on the shiprocket dashboard. It is mandatory to verify the pickup location address that is created.</p><p>The verification is done either by the OTP or by IVR call.</p><p>For address verification, either the OTP or a call will be made to the seller&#39;s contact number.</p><p>The Settings&gt;&gt;Pickup address&gt;&gt;Manage pickup address.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/02/image-4-1200x549.png" alt="image-4"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/02/image-4-1-1200x561.png" alt="image-4-1"></p><p><strong>Note-</strong> If shiprocket shipping is enabled and the seller&#39;s address is changed, a new pickup location is automatically created on the Shiprocket dashboard.</p><p>This new location will be used as a primary location.</p><h3 id="order-fulfillment" tabindex="-1">Order Fulfillment <a class="header-anchor" href="#order-fulfillment" aria-label="Permalink to &quot;Order Fulfillment&quot;">​</a></h3><p><strong>The</strong> <strong>Mandatory conditions for order fulfillment</strong>-</p><ul><li>The Contact number is mandatory.</li><li>The Contact number must be exact digits without code.</li><li>The Seller address must be valid with a valid pincode.</li><li>House number of the seller is mandatory.</li><li>The Global shipping configuration is mandatory.</li><li>SKU is mandatory while adding a product.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/04/sku.png" alt="sku"></p><p>The seller needs to follow the below-given steps to fulfill the orders:</p><ul><li>Login to the Multi-vendor <strong>Seller Panel</strong>.</li><li>Go to the Orders&gt;&gt; Order listing section.</li><li>Select the order you want to fulfill.</li><li>Click on <strong>Proceed to Fulfill the order</strong>.</li><li>select the Shiprocket as the fulfillment method.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/01/Order-_-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Order-_-Seller-•-Multivendor-MarketPlace"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="Order-Details-_-Seller-•-Multivendor-MarketPlace"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/01/Order-Proceed-_-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x597.png" alt="Order-Proceed-_-Seller-•-Multivendor-MarketPlace"></p><h3 id="generate-shipping-label" tabindex="-1">Generate Shipping Label <a class="header-anchor" href="#generate-shipping-label" aria-label="Permalink to &quot;Generate Shipping Label&quot;">​</a></h3><p>Both admin and seller can generate the shipping label for the fulfilled orders.</p><p>You can configure the shipping Label details from the admin panel&gt;&gt;Shiprocket Configuration.</p><p>The seller can generate the shipping label for fulfilled orders by following the steps given below-</p><ul><li>Login to Multi-vendor <strong>Seller</strong> <strong>Panel</strong>.</li><li>Go to <strong>Orders Section</strong>.</li><li>Visit the <strong>Order Listing</strong> section.</li><li>Click on <strong>view</strong>.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/02/Order-_-Seller-%E2%80%A2-Multivendor-MarketPlace-1-1200x627.png" alt="Order-_-Seller-•-Multivendor-MarketPlace-1"></p><p>The seller can generate/print the shipping label by clicking on the action button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="Order-Details-_-Seller-•-Multivendor-MarketPlace-4"></p><p>Thus, the shipping label will be generated automatically for the fulfilled orders. The seller can easily print the shipping label from here.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/02/shiprocket-shipping-label-converted-2-683x1024.jpg" alt="shiprocket-shipping-label-converted-2"></p><p>That’s all about the Shiprocket Shipping Feature App.</p><h3 id="demo" tabindex="-1">Demo <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;Demo&quot;">​</a></h3><p>Link to check the demo of Multi-vendor Marketplace app for Shopify: <br><a href="https://multivendor-marketplace-5.myshopify.com/" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com</a></p>',76)])])}const u=t(r,[["render",a]]);export{d as __pageData,u as default};
